import azure_devops from '../images/azure_devops.png';

const Project = () => {

    return(
        <div>
            <div>
                <h1>Projects</h1>
            </div>
            <div class="project-container">
                <div class="flex-project1">
                    <img src={azure_devops} width={300} height={75} alt="cpp" className="skills_img_icons" />
                </div>
                <div class="flex-project2">2</div>
            </div>
        </div>
    );
}

export default Project;
